    "# Check if a value is blank\n",
    "is.blank <- function(x) {\n",
    "  return(is.na(x) || (is.character(x) && trimws(x) == \"\"))\n",
    "}\n",
    "\n",
    "# Replace blank values with NA in the entire data frame\n",
    "data[data == \"\"] <- NA\n",
    "data[sapply(data, is.blank)] <- NA\n",
    "str(data)"
