    "# Replace missing values in numeric columns with mean using the ave function\n",
    "numeric_columns <- c(\"Age\", \"DailyRate\", \"HourlyRate\", \"MonthlyIncome\", \"MonthlyRate\",\n",
    "                     \"NumCompaniesWorked\", \"PercentSalaryHike\", \"YearsAtCompany\",\n",
    "                     \"YearsInCurrentRole\", \"YearsSinceLastPromotion\", \"YearsWithCurrManager\",\n",
    "                     \"TrainingTimesLastYear\")\n",
    "\n",
    "for (col in numeric_columns) {\n",
    "  ds[[col]] <- ifelse(is.na(ds[[col]]),\n",
    "                      ave(ds[[col]], FUN = function(x) mean(x, na.rm = TRUE)),\n",
    "                      ds[[col]])\n",
    "}"
   ]
  },
