   "source": [
    "# Filter out numerical variables from the data\n",
    "numerical_vars <- ds[, sapply(ds, is.numeric)]\n",
    "\n",
    "# Calculate the number of rows and columns for the plot layout\n",
    "num_rows <- ceiling(length(numerical_vars) / 4)\n",
    "num_cols <- min(length(numerical_vars), 4)\n",
    "\n",
    "# Increase the size of the plot\n",
    "par(mfrow = c(num_rows, num_cols))\n",
    "options(repr.plot.width = 12, repr.plot.height = 12)  # Set the figure size\n",
    "\n",
    "# Create boxplots for each numerical variable\n",
    "for (var in colnames(numerical_vars)) {\n",
    "  boxplot(ds[[var]], main = var, ylab = \"Value\")\n",
    "}"
   ]
