    "library(ggplot2)\n",
    "library(gridExtra)\n",
    "\n",
    "# Filter out categorical variables from the data\n",
    "categorical_vars <- ds[, sapply(ds, function(x) is.factor(x) || is.character(x))]\n",
    "\n",
    "# Calculate the number of rows and columns for the plot layout\n",
    "num_rows_cat <- ceiling(length(categorical_vars) / 4)\n",
    "num_cols_cat <- 4\n",
    "\n",
    "# Set the figure size\n",
    "options(repr.plot.width = 10, repr.plot.height = 5 * num_rows_cat)\n",
    "\n",
    "# Create a list to store individual ggplot objects\n",
    "plot_list <- vector(\"list\", length = ncol(categorical_vars))\n",
    "\n",
    "# Create bar plots for each categorical variable\n",
    "for (i in seq_along(categorical_vars)) {\n",
    "  var <- names(categorical_vars[i])\n",
    "  plot_list[[i]] <- ggplot(data = categorical_vars, aes(x = .data[[var]])) +\n",
    "    geom_bar() +\n",
    "    labs(title = var, y = \"Frequency\") +\n",
    "    theme(axis.text.x = element_text(angle = 45, hjust = 1))  # Rotate x-axis labels for readability\n",
    "}\n",
    "\n",
    "# Display the plots using grid.arrange\n",
    "grid.arrange(grobs = plot_list, ncol = num_cols_cat)\n"
   ]
  },
