   "source": [
    "#Outlier Treatment \n",
    "#Remove outliers with IQR method\n",
    "num_vars <- c(\"Age\", \"DailyRate\", \"HourlyRate\", \"MonthlyIncome\", \"MonthlyRate\", \"TotalWorkingYears\", \"YearsAtCompany\", \"YearsInCurrentRole\", \"YearsSinceLastPromotion\", \"YearsWithCurrManager\")\n",
    "for (var in num_vars) {\n",
    "  Q1 <- quantile(ds[[var]], 0.25)\n",
    "  Q3 <- quantile(ds[[var]], 0.75)\n",
    "  IQR <- Q3 - Q1\n",
    "  lower_bound <- Q1 - 1.5 * IQR\n",
    "  upper_bound <- Q3 + 1.5 * IQR\n",
    "  ds <- ds[ds[[var]] >= lower_bound & ds[[var]] <= upper_bound, ]\n",
    "}"
   ]
  },
