    "library(ggplot2)\n",
    "library(gridExtra)\n",
    "\n",
    "# Select categorical variables for bivariate analysis\n",
    "categorical_vars_bivariate <- c(\"BusinessTravel\", \"Department\", \"Education\", \"EducationField\",\n",
    "                                \"EnvironmentSatisfaction\", \"Gender\", \"JobInvolvement\",\n",
    "                                \"JobLevel\", \"JobRole\", \"JobSatisfaction\", \"MaritalStatus\",\n",
    "                                \"OverTime\", \"PerformanceRating\", \"RelationshipSatisfaction\",\n",
    "                                \"StockOptionLevel\", \"WorkLifeBalance\")\n",
    "\n",
    "# Create a list to store individual ggplot objects\n",
    "plot_list_cat <- vector(\"list\", length = length(categorical_vars_bivariate))\n",
    "\n",
    "# Create stacked bar plots for each categorical variable\n",
    "for (i in seq_along(categorical_vars_bivariate)) {\n",
    "  var <- categorical_vars_bivariate[i]\n",
    "  p <- ggplot(data = ds, aes(x = .data[[var]], fill = factor(Attrition))) +\n",
    "    geom_bar(position = \"stack\") +\n",
    "    labs(title = paste(\"Attrition by\", var), y = \"Frequency\") +\n",
    "    theme(axis.text.x = element_text(angle = 45, hjust = 1), legend.position = \"top\") +\n",
    "    scale_fill_discrete(name = \"Attrition\", labels = c(\"Not Attrited\", \"Attrited\"))\n",
    "  \n",
    "  plot_list_cat[[i]] <- p\n",
    "}\n",
    "\n",
    "# Arrange the plots in a grid layout using grid.arrange\n",
    "grid.arrange(grobs = plot_list_cat, ncol = 2)  # Change the number of columns as per your preference"
   ]
  },
