    "finaldata$Attrition <- as.factor(finaldata$Attrition)\n",
    "\n",
    "# Data splitting\n",
    "\n",
    "library(caTools)\n",
    "set.seed(123)\n",
    "split <- sample.split(finaldata$Attrition, SplitRatio = 0.8)\n",
    "training_set <- subset(finaldata, split == TRUE)\n",
    "test_set <- subset(finaldata, split == FALSE)\n",
    "\n",
    "# Check class distribution\n",
    "table(finaldata$Attrition)\n",
    "prop.table(table(finaldata$Attrition))\n",
    "prop.table(table(training_set$Attrition))\n",
    "prop.table(table(test_set$Attrition))"
   ]
