    "# Logistic Regression\n",
    "library(glmnet)\n",
    "\n",
    "# Train the logistic regression model\n",
    "classifier_lr <- glm(Attrition ~ ., data = training_set_over, family = \"binomial\")\n",
    "\n",
    "# Make predictions on the training set\n",
    "pred_train_lr <- predict(classifier_lr, newdata = training_set_over, type = \"response\")\n",
    "pred_class_train_lr <- ifelse(pred_train_lr > 0.5, 1, 0)\n",
    "\n",
    "# Make predictions on the test set\n",
    "pred_test_lr <- predict(classifier_lr, newdata = test_set, type = \"response\")\n",
    "pred_class_test_lr <- ifelse(pred_test_lr > 0.5, 1, 0)\n",
    "\n",
    "# Evaluate performance\n",
    "cm_train_lr <- confusionMatrix(factor(pred_class_train_lr), factor(training_set_over$Attrition), positive=\"1\")\n",
    "cm_train_lr\n",
    "cm_test_lr <- confusionMatrix(factor(pred_class_test_lr), factor(test_set$Attrition), positive=\"1\")\n",
    "cm_test_lr\n",
    "\n",
    "# Training set accuracy\n",
    "train_accuracy_lr <- cm_train_lr$overall[\"Accuracy\"]\n",
    "train_accuracy_lr\n",
    "\n",
    "# Test set accuracy\n",
    "test_accuracy_lr <- cm_test_lr$overall[\"Accuracy\"]\n",
    "test_accuracy_lr"
   ]
  },
