    "# Make predictions on the test set\n",
    "pred_test_dt <- predict(classifier_dt, newdata = test_set, type = \"class\")\n",
    "\n",
    "# Evaluate performance\n",
    "cm_train_dt <- confusionMatrix(pred_train_dt, training_set_over$Attrition, positive = \"1\")\n",
    "cm_train_dt\n",
    "cm_test_dt <- confusionMatrix(pred_test_dt, test_set$Attrition, positive = \"1\")\n",
    "cm_test_dt\n",
    "\n",
    "# Training set accuracy\n",
    "train_accuracy_dt <- cm_train_dt$overall[\"Accuracy\"]\n",
