    "# Random Forest\n",
    "library(randomForest)\n",
    "\n",
    "# Train the random forest model\n",
    "classifier_rf <- randomForest(Attrition ~ ., data = training_set_over)\n",
    "\n",
    "# Make predictions on the training set\n",
    "pred_train_rf <- predict(classifier_rf, newdata = training_set_over)\n",
    "\n",
    "# Make predictions on the test set\n",
    "pred_test_rf <- predict(classifier_rf, newdata = test_set)\n",
    "\n",
    "# Evaluate performance\n",
    "cm_train_rf <- confusionMatrix(pred_train_rf, training_set_over$Attrition, positive = \"1\")\n",
    "cm_train_rf\n",
    "cm_test_rf <- confusionMatrix(pred_test_rf, test_set$Attrition, positive = \"1\")\n",
    "cm_test_rf\n",
    "\n",
    "# Training set accuracy\n",
    "train_accuracy_rf <- cm_train_rf$overall[\"Accuracy\"]\n",
    "train_accuracy_rf\n",
    "\n",
    "# Test set accuracy\n",
    "test_accuracy_rf <- cm_test_rf$overall[\"Accuracy\"]\n",
    "test_accuracy_rf"
   ]
