   "source": [
    "# Accuracy values\n",
    "# Create a data frame with classifier names and accuracy values\n",
    "data <- data.frame(Classifier = c(\"LR\", \"DT\", \"RF\", \"NB\"),\n",
    "                   Accuracy = c(train_accuracy_lr, train_accuracy_dt, train_accuracy_rf, train_accuracy_nb),\n",
    "                   Dataset = \"Training Set\",\n",
    "                   stringsAsFactors = FALSE)\n",
    "\n",
    "# Append test set accuracy values to the data frame\n",
    "data <- rbind(data, data.frame(Classifier = c(\"LR\", \"DT\", \"RF\", \"NB\"),\n",
    "                              Accuracy = c(test_accuracy_lr, test_accuracy_dt, test_accuracy_rf, test_accuracy_nb),\n",
    "                              Dataset = \"Test Set\",\n",
    "                              stringsAsFactors = FALSE))\n",
    "\n",
    "# Convert Dataset column to factor with appropriate levels\n",
    "data$Dataset <- factor(data$Dataset, levels = c(\"Training Set\", \"Test Set\"))\n",
    "\n",
    "# Create the bar plot using ggplot2\n",
    "ggplot(data, aes(x = Classifier, y = Accuracy, fill = Dataset)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  geom_text(aes(label = paste0(round(Accuracy * 100, 2), \"%\")), position = position_dodge(width = 0.9), vjust = -0.5, size = 3) +\n",
    "  labs(title = \"Accuracy Comparison of Classifiers\",\n",
    "       x = \"Classifier\", y = \"Accuracy\") +\n",
    "  scale_fill_manual(values = c(\"salmon\", \"lightblue\"),\n",
    "                    labels = c(\"Training Set\", \"Test Set\")) +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1),\n",
    "        axis.text.y = element_text(size = 8))"
   ]
  },
